import React from 'react';
import app from '../styles/LandingPage.module.css';

const Header = () => {
  return (
    <header className={app.header}>
      <article className={app.cta}>
        <h1 className={app['cta-title']}>Find your friend circle</h1>
        <p>Groups based on your interests, personality type, online around the world, people that really get you.</p>
        <button className="btn btn--orange" type="button">
          Start Free
          </button>
      </article>
      <div className={app.down}>
        <svg className={app['down-arrow']} aria-hidden="true" focusable="true" data-prefix="fal" data-icon="chevron-down" role="button" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 448 512" className="svg-inline--fa fa-chevron-down fa-w-14 fa-2x">
          <path fill="currentColor" d="M443.5 162.6l-7.1-7.1c-4.7-4.7-12.3-4.7-17 0L224 351 28.5 155.5c-4.7-4.7-12.3-4.7-17 0l-7.1 7.1c-4.7 4.7-4.7 12.3 0 17l211 211.1c4.7 4.7 12.3 4.7 17 0l211-211.1c4.8-4.7 4.8-12.3.1-17z" class=""></path>
        </svg>
      </div>
    </header>
  )
}

export default Header;
